import React from "react";
import "./Category.css";
import PhoneIcon from "../assets/Phones.svg";

export default function () {
  return (
    <div>
      <p>browse By Category</p>
      <div>
        <div className="category">
          <img src={PhoneIcon} />
          <p>Phones</p>
        </div>
      </div>
    </div>
  );
}
